import "./tip.css"; 
const tips=(props)=>{
    return(
        <div id="tip">
            {props.tips && props.tips.map((tip, index) => (
                <div key={index} id="tip-arrow">{tip}</div>
            ))}
        </div>
    )
}
export default tips
